import React from 'react';

const Login = ({ unameRef, pwordRef, handleLogin }) => {
  return (
    <div>
      <h1>Login</h1>
      <div>
        Username <input type="text" ref={unameRef} />
      </div>
      <div>
        Password <input type="password" ref={pwordRef} />
      </div>
      <div>
        <button onClick={handleLogin}>Login</button>
      </div>
      <div>
        <a href="/register">Don't have an account? Register here</a>
      </div>
    </div>
  );
};

export default Login;




